import Card from 'componentes/Card';
import Header from 'componentes/Header';

import { notifications } from './dummy';

function App() {
  return (
    <div className="App notifications-page">
      <Header />
      {notifications.map((notification, index) => {
        return (
          <Card key={index} />
        )
      })}
    </div>
  );
}

export default App;
